		countfps++;
		Webcam.snap(function (data_uri) {
			document.getElementById('results').innerHTML =
				'<img src=""' + data_uri + '""/>';
		});

	}

	setInterval(function () {
		if (countfps > 60) 
			countfps = 60;
        
		$(""#fps"").html(countfps);
